description:
Verenigde Staten
Horror
102 minuten

goed

met Tony Todd, Jolene Blalock en Marc Winnick

Ze ontwaakt in een cel. Ze weet niet wie ze is, waar ze is of hoe ze hier is geraakt. Ze ontmoet lotgenoten. Zij kunnen zich 
eveneens niet herinneren wie of waar ze zijn. Maar ze zijn het allemaal eens dat ze een uitgang moeten vinden. Want ze horen 
beangstigende geluiden, afkomstig van schaduwen die erop uit zijn om het leven uit hen te zuigen.
